window.bookSummaryJSON = "<p><b>Finally, back on Earth, Jake has to adapt and evolve as his hunt continues....</b></p> <p>With a huge open planet before him, Jake has literally grown wings as he begins his conquest of the local wildlife. With his newfound freedom, he finds his true Path as a hunter. All the while trying to avoid the responsibilities of having founded the first city on the planet. Oh, and bird friends. </p> <p>Meanwhile, all across Earth, Pylons of Civilization are claimed. Cities are constructed, humanity beginning to regain its foothold. Factions grow and expand as political alliances are formed and professional relations are created, as godly and mortal factions alike move to establish themselves as the dominant force on Earth. </p> <p>None of which Jake cares too much about while he finds himself far too busy doing what is truly important in life: </p> <p>Hunting, alchemy, and getting that D-grade <a href=\"http://evolution.book/\">evolution.</a></p> <p><a href=\"http://evolution.book/\">Book</a> three of the hit Primal Hunter LitRPG series is here. Grab your copy today!</p> <p><b>About the Series:</b> Experience an Apocalypse LitRPG with levels, classes, professions, skills, dungeons, loot, and all of the great traits of progression fantasy and LitRPG that you've come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities. As he grows in power and slowly transforms from a bored office worker to a true apex hunter.</p>"; 
